import './App.css';
import { get_users } from './graphql/queries';
import { useQuery } from '@apollo/client';
import { useState,useEffect } from 'react';
function App() {
  const data=useQuery(get_users)
  const [test,setTest]=useState([])
  useEffect(() => {
    setTest(useQuery(get_users))
  }, [])

  return (
    <div className="App">
      <h1>Users</h1>
      {test.map((x)=>(
           <p>{x.nom}</p>
      ))}
    </div>
  );
}

export default App;
